import React,{Component} from "react";
import Footer from "./Footer";
import './Footer_part_one.css';
import img from './React_icon_here.png';

class Footer_part_one extends Component {
    render() {
        return(
            <div className="Main_Footer_part_one">
                <div className="Main_Footer_part_one_one">
                    <h2>About Me</h2>
                    <p>Hey there, I am sahil ,a 19 year old motivational and consistent hard working youth. I am a react website developer who believes in writing clean, elegant and useful code which describes itself.</p>
                </div>

                <div className="Main_Footer_part_one_two">
                    <h2>Technologies Used</h2>
                        <p><img src={img}  width="20px" style={{margin : "10px"}}/> React Javascript</p>
                        <p>CSS</p>
                </div>
            </div>
        );
    }
}

export default Footer_part_one;
